import React from 'react';
import { Bell, Clock } from 'lucide-react'; 
import { useNavigate } from 'react-router-dom'; 

const Dashboard = ({ user, events, theme, regCount }) => {
  const navigate = useNavigate(); 
  const isDark = theme === 'dark';

  const styles = {
    container: { 
      padding: '16px', 
      paddingBottom: '100px', 
      minHeight: '100vh',
      backgroundColor: isDark ? '#0f172a' : '#fff',
    },
    header: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' },
    greeting: { fontSize: '32px', fontWeight: 'bold', margin: '10px 0 5px 0', color: isDark ? '#fff' : '#1e293b' },
    subText: { color: '#64748b', fontSize: '14px', marginBottom: '24px' },
    statsRow: { 
      display: 'grid', 
      gridTemplateColumns: 'repeat(2, 1fr)', 
      gap: '12px', 
      marginBottom: '30px' 
    },
    statCard: { 
      backgroundColor: isDark ? '#1e293b' : '#f8fafc', 
      padding: '16px', 
      borderRadius: '16px', 
      color: isDark ? '#fff' : '#1e293b',
      border: isDark ? '1px solid #334155' : '1px solid #e2e8f0',
      display: 'flex',
      flexDirection: 'column',
      gap: '4px'
    },
    sectionHeader: {
      display: 'flex', 
      justifyContent: 'space-between', 
      alignItems: 'center', 
      marginBottom: '15px'
    },
    seeAllBtn: {
      background: 'none',
      border: 'none',
      color: '#2563eb',
      fontSize: '14px',
      fontWeight: 'bold',
      cursor: 'pointer'
    },
    eventCard: { 
      backgroundColor: isDark ? '#1e293b' : '#fff', 
      borderRadius: '24px', 
      padding: '16px', 
      marginBottom: '16px',
      border: isDark ? '1px solid #334155' : '1px solid #f1f5f9',
      boxShadow: '0 4px 6px rgba(0,0,0,0.02)',
      cursor: 'pointer'
    },
    regBtn: { 
      width: '100%', 
      backgroundColor: '#2563eb', 
      color: '#fff', 
      border: 'none', 
      padding: '12px', 
      borderRadius: '12px', 
      fontWeight: 'bold', 
      marginTop: '12px',
      fontSize: '14px',
      cursor: 'pointer'
    }
  };

  return (
    <div style={styles.container}>
      {/* Header */}
      <header style={styles.header}>
        <div style={{ display: 'flex', alignItems: 'center', gap: '10px' }}>
          <div style={{ width: '40px', height: '40px', borderRadius: '50%', backgroundColor: '#2563eb', color: '#fff', display: 'flex', justifyContent: 'center', alignItems: 'center', fontWeight: 'bold' }}>ES</div>
          <span style={{ fontWeight: 'bold', fontSize: '18px', color: isDark ? '#fff' : '#1e293b' }}>EventSphere</span>
        </div>
        <div style={{ display: 'flex', gap: '15px', color: isDark ? '#94a3b8' : '#1e293b' }}>
          {/* Navigates to the Notification Route we created */}
          <Bell size={24} onClick={() => navigate('/notifications')} style={{ cursor: 'pointer' }} />
        </div>
      </header>

      <h1 style={styles.greeting}>Hi {user.name.split(' ')[0]} ðŸ‘‹</h1>
      <p style={styles.subText}>Explore college events</p>

      {/* Stats Row */}
      <div style={styles.statsRow}>
        <div style={styles.statCard}>
          <div style={{ fontSize: '14px', color: '#64748b' }}>Upcoming</div>
          <div style={{ fontSize: '24px', fontWeight: 'bold' }}>{events.length}</div>
        </div>
        <div style={styles.statCard}>
          <div style={{ fontSize: '14px', color: '#64748b' }}>Registered</div>
          <div style={{ fontSize: '24px', fontWeight: 'bold' }}>{regCount}</div>
        </div>
      </div>

      {/* Upcoming Events Header with "See All" */}
      <div style={styles.sectionHeader}>
        <h3 style={{ fontSize: '18px', margin: 0, color: isDark ? '#fff' : '#1e293b' }}>Upcoming Events</h3>
        <button style={styles.seeAllBtn} onClick={() => navigate('/events')}>See All</button>
      </div>
      
      {/* Only show the first 2 events */}
      {events.slice(0, 2).map(event => (
        <div key={event.id} style={styles.eventCard} onClick={() => navigate(`/event-details/${event.id}`)}>
          <img src={event.image} alt={event.title} style={{ width: '100%', height: '160px', objectFit: 'cover', borderRadius: '16px', marginBottom: '12px' }} />
          <h4 style={{ margin: '0 0 8px 0', fontSize: '18px', color: isDark ? '#fff' : '#1e293b' }}>{event.title}</h4>
          <div style={{ display: 'flex', alignItems: 'center', gap: '8px', fontSize: '14px', color: '#64748b' }}>
            <Clock size={16} /> {event.date}
          </div>
          <button style={styles.regBtn}>
            {event.isRegistered ? "View Ticket" : "Register Now"}
          </button>
        </div>
      ))}
    </div>
  );
};

export default Dashboard;
